import React from "react";
import Header from "../COMPANENTS/Header";

const AddCategory = (props) => {
	useEffect(() => {
		document.title = "Library - Add Category";
	});
	return (
		<>
			<Header />
			<div className="Page-text">
				<h1> ADD NEW CATEGORY </h1>
			</div>
		</>
	);
};

export default AddCategory;
